import React from 'react';
import { Container, Row, Col, Button } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';

function Home() {
  const navigate = useNavigate();
  return (
    <Container fluid className="py-5" style={{ backgroundColor: '#f0f4f8' }}>
      <Row className="align-items-center">
        <Col md={6}>
          <h1>Gestion de la clinique vétérinaire</h1>
          <p>Administrez les dossiers des animaux, les rendez-vous, et plus</p>
          <Button variant="outline-primary" className="me-2" onClick={() => navigate('/veterinarians')}>
            Vétérinaires
          </Button>
          <Button variant="primary" onClick={() => navigate('/owners')}>
            Propriétaires
          </Button>
        </Col>
        <Col md={6}>
          {/* Image placeholder */}
        </Col>
      </Row>
    </Container>
  );
}

export default Home;
